/** @format */

import substrCount, { isSpecial } from "./special-palindrome-again";

describe("isStringSpecial", () => {
  test("Test 1", () => {
    expect(isSpecial("mnonopoo")).toBe(false);
  });

  test("Test 2", () => {
    expect(isSpecial("asasd")).toBe(false);
  });

  test("Test 3", () => {
    expect(isSpecial("aabaa")).toBe(true);
  });

  test("Test 4", () => {
    expect(isSpecial("aaaa")).toBe(true);
  });

  test("Test 5", () => {
    expect(isSpecial("a")).toBe(true);
  });
});

describe("special-palindrome-again", () => {
  test("Test 1", () => {
    expect(substrCount("mnonopoo")).toBe(12);
  });

  test("Test 2", () => {
    expect(substrCount("asasd")).toBe(7);
  });

  test("Test 3", () => {
    expect(substrCount("abcbaba")).toBe(10);
  });

  test("Test 4", () => {
    expect(substrCount("aaaa")).toBe(10);
  });

  test("Test 5", () => {
    expect(substrCount("aaaabaaaac")).toBe(25);
  });

  test("Test 6", () => {
    expect(
      substrCount(
        "",
      ),
    ).toBe(708774);
  });
});
